def count_stable_arrays(n, k):
    MOD = 998244354

    def combination(n, k, p):
        if k > n:
            return 0
        num = 1
        for i in range(n, n - k, -1):
            num = num * i % p
        denom = 1
        for i in range(1, k + 1):
            denom = denom * i % p
        return num * pow(denom, p - 2, p) % p
    if k > n:
        return 0
    elif k == 1:
        return n
    else:
        result = combination(n - 1, k - 1, MOD)
        for i in range(2, n):
            if i * k > n:
                break
            el = n // i
            result += combination(el - 1, k - 1, MOD)
            result %= MOD
        return result

